import React from "react";
import Card from "./context";
import Bank from "./bank.png";

function Home() {
  return (
    <Card
      bgcolor="primary"
      txtcolor="white"
      header="Welcome to the Bank"
      title="Welcome to the bank"
      text="For all your banking needs."
      body={
        <img
          src={require("./bank.png")}
          className="img-fluid"
          alt="Responsive image"
        />
      }
    />
  );
}
export default Home;
